在网上看到这样一个问题,你能想出几种方案,我们很容易就会想到float, position,flex,然后绞尽脑汁再也想不出来了,现在记录下来
### 第一种方案: float
```html
<section class="layout float">
    <div  class="left"></div>
    <div class="right"></div>
    <div class="center">
        <h1>浮动解决方案</h1>
    </div>
</section>
```
```css
.left {
width: 300px;
	background-color: red;
}
.right {
	width: 300px;
	background-color: blue;
}
.float .left {
	float: left;
}
.float .right {
	float: right;
}
section.layout div {
	min-height: 100px;
}
.center {
	background-color: yellow;
}
```
### 第二种方案: position
```html
<section class="layout position">
	<div class="right"></div>
	<div class="left"></div>
	<div class="center">
		<h1>绝对定位解决方案</h1>
	</div>
</section>
```
```css
section.position {
	position: relative;
}

section.position .left {
	position: absolute;
	left: 0;
}

section.position .right {
	position: absolute;
	right: 0;
}

section.position .center {
	margin-left: 300px;
	margin-right: 300px;
}
```

ES6， 全称 ECMAScript 6.0 ，是 JavaScript 的下一个版本标准，2015.06 发布。涵盖了 ES2015、ES2016、ES2017 等等，ES6 主要是为了解决 ES5 的先天不足。
### var
通过`var`定义的全局变量,会变量提升,作用域是全局的,可以重复声明,不会出现报错,也没有提示.
```javascript
console.log(a) // undefined
var a = 1;
var a = 2;
console.log(a) // 2
```
当多人协作开发时,修改某一块的代码时,有可能会造成重复声明了相同的变量,导致我们所需要的数据被覆盖,而我们可能需要好长时间去检查才会找到问题的所在,这时我们有需要`let`

### let
定义变量,和var一样,不过一般用于块级作用域,也就是花括号{},ES6推荐在函数中使用let,而不是var
```javascript
let a = 1;
let a = 5;
console.log(a);
// 会报错(a已经被声明了) Identifier 'a' has already been declared
{
let b = 1;
}
console.log(b); // ReferenceError: b is not defined
```
不会变量提升
```javascript
console.log(a); // ReferenceError: a is not defined
let a = 1;
let b;
console.log(b) // undefined
```
有5个`li`标签,通过点击事件获取`li`的索引
```javascript
for(var i = 0; i < 5; i++){
	aLi[i].i = i;
	aLi[i].onclick = function () {
		alert(this.i) // 0 1 2 3 4
	}
}
```
我们会发现所有`li`的索引都是最后一个`i`值,这是由于JS引擎执行是按照从左到右的顺序,先执行了`for`循环,同时将循环中的代码也一并执行了,这个时候`i`的值已经成了最后一个,然后才给`click`事件绑定的
解决办法:
1. 使用闭包

```javascript
let aLi = document.getElementsByTagName('li');
for(var i = 0; i < 5; i++){
	(function (i){
		aLi[i].onclick = function () {
			alert(i) // 0 1 2 3 4
		}
	})(i)
}
```
2. 使用自定义属性

```javascript
for(var i = 0; i < 5; i++){
	aLi[i].i = i;
	// 给标签添加一个自定义属性
	aLi[i].onclick = function () {
		alert(this.i) // 0 1 2 3 4
		// 这里this.i指的是自定义属性的i
	}
}
```
但这样终究是让我们多写了几行代码,我们的宗旨是能少写就少写,能不写就不写,这里我们把`var`换成`let`就解决了,是不是简单很多
```javascript
for(let i = 0; i < 5; i++){
	aLi[i].onclick = function () {
		alert(i) // 0 1 2 3 4
	}
}
```
### const
通过`const`定义的变量不可以修改,而且必须初始化

```javascript
const TYPE;
// 会报错,必须赋值完成初始化  Missing initializer in const declaration

const TYPE = 1;
TYPE = 2;
// 也会报错,定义的常量不可以修改 Assignment to constant variable.
```
总结:

`let`声明的变量不具备变量提升;`let` 和 `const` 声明只在最靠近的一个块中（花括号内）有效;使用常量`const` 声明时必须被赋值;定义常量时使用大写变量表示,符合规范

ES6标准新增了一种新的函数：Arrow Function（箭头函数）,
箭头函数表达式的语法比函数表达式更简洁，并且没有自己的this，arguments，super或 new.target。这些函数表达式更适用于那些本来需要匿名函数的地方，并且它们不能用作构造函数
在了解箭头函数前,我们先看一个常规例子:
```javascript
function fn(){
	console.log('hello~')
}
fn() // hello~
```
再来看看箭头函数如何表示的
```javascript
fn = () => {
	console.log('hello~')
}
fn() // hello~
```
是不是简单很多,再来看看这条,这种只适用于只有一条语句时,可以省略大括号`{}`
```javascript
fn = () => console.log('hello~')
fn() // hello~
```
如果我们需要传第一个和多个参数呢?
```javascript
// 只有一个参数
fn = (a) => a + 2
// 只有一个参数时还可以省略小括号
fn =a => a + 2

// 多个参数
fn = (a,b,c) a + b + c
```
我们在来看看这个例子:
```javascript
const Person = {
	name: 'Superficial',
	age:23,
	'get': function() {
		setInterval(function (){
			console.log(this.age)
		})
	}
}
Person.get() // undefined
```
结果是不是出乎意料,没错,相信自己的眼睛,你没看错,这是由于[this指向](https://bonsaiden.github.io/JavaScript-Garden/zh/#function.this "this指向"){:target=_blank}的问题
以前的写法是在函数中把this绑定到变量上
```javascript
const Person = {
	name: 'Superficial',
	age:23,
	'get': function() {
		let that = this;
		setInterval(function (){
			console.log(that.age)
		})
	}
}
Person.get() // 23
```

查看详细[箭头函数的语法](https://developer.mozilla.org/zh-CN/docs/Web/JavaScript/Reference/Functions/Arrow_functions#Syntax "箭头函数"){:target=_blank}相关内容

Sitemap可方便网站管理员通知搜索引擎他们网站上有哪些可供抓取的网页。最简单的 Sitemap 形式，就是XML 文件，在其中列出网站中的网址以及关于每个网址的其他元数据（上次更新的时间、更改的频率以及相对于网站上其他网址的重要程度为何等），以便搜索引擎可以更加智能地抓取网站

在`django`中添加`sitemap`,首先要把相关APP应用安装到`settings.py`中的`INSTALL_APP`中,这里无需使用`pip`,`django`从1.6开始，默认情况下不启用`site`框架,所以我们只需要启用即可~
```django
INSTALL_APP = [
	''',
	'django.contrib.sites',
	'django.contrib.sitemaps',
]
SITE_ID = 1
```
这里我还添加了SITE_ID= 1,如过不设置可能会登录后台报错,表示指定当前站点
然后登录后台,会多了一个站点(SITE)
![站点](/media/editor/site_20190424150435619391.png "站点")
修改为你自己的域名和名称,如果你是本地开发域名为设置为127.0.0.1:8000
### 添加sitemap功能
在项目文件夹下新增`sitemap.py`
```django
from django.contrib.sitemaps import Sitemap
from apps.blog.models import Article, Category, Tag
from django.urls import reverse

class ArticleSiteMap(Sitemap):
    """changefreq 更新频率
        priority 相对于其它页面的优先权"""
    changefreq = "monthly"
    priority = "0.6"

    def items(self):
        return Article.objects.all()

    def lastmod(self, obj):
        """上次修改时间"""
        return obj.modified_time

    def location(self, obj):
        """可选.返回每个对象的绝对路径.如果对象有get_absolute_url()方法,可以省略location"""
        return reverse('blog:detail', kwargs={'pk': int(obj.id)})


class CategorySiteMap(Sitemap):
    changefreq = "Weekly"
    priority = "0.6"

    def items(self):
        return Category.objects.all()

    def lastmod(self, obj):
        return obj.modified_time

    def location(self, obj):
        """可选.返回每个对象的绝对路径.如果对象有get_absolute_url()方法,可以省略location"""
        return reverse('blog:category', kwargs={'pk': int(obj.id)})


class TagSiteMap(Sitemap):
    """
        changefreq 更新频率
        priority 相对于其它页面的优先权
    """
    changefreq = "Weekly"
    priority = "0.3"

    def items(self):
        return Tag.objects.all()

    def lastmod(self, obj):
        return obj.modified_time

    def location(self, obj):
        """可选.返回每个对象的绝对路径.如果对象有get_absolute_url()方法,可以省略location"""
        return reverse('blog:tags', kwargs={'pk': obj.id})
```
### urls.py增加
```django
from DjangoBlog.sitemap import ArticleSiteMap, CategorySiteMap, TagSiteMap
sitemaps = {
    'blog': ArticleSiteMap,
    'Category': CategorySiteMap,
    'Tag': TagSiteMap,
}

re_path(r'^sitemap\.xml$', sitemap, {'sitemaps': sitemaps},
        name='django.contrib.sitemaps.views.sitemap'),
```
浏览器中访问: http://127.0.0.1:8000/sitemap.xml

Grid 布局是 CSS 中最强大的布局系统。与 flexbox 的一维布局系统不同，Grid 布局是一个二维布局系统，也就意味着它可以同时处理列和行。通过将 CSS 规则应用于 父元素 (成为 Grid Container 网格容器)和其 子元素（成为 Grid Items 网格项），你就可以轻松使用 Grid(网格) 布局。

Gird通过将元素的父级设置`display: grid`,来声明这是一个grid容器,来转化为网格布局。
#### 容器属性(Grid Container)
```css
display: grid || inline-grid;
// 声明一个容器,块状||内联
grid-template-columns: 25% 25% 25% 25%;
// 定义列，有多少个参数就多少列,参数之间用逗号隔开
grid-template-rows: 25% 100px auto;
// 定义行，有多少个参数就多少行,参数之间用逗号隔开
grid-column-gap
// 列间距
grid-column-gap
// 行间距
justify-items:start | end | center | stretch(默认);
// 水平方向对齐,左对齐|右对齐|居中|填充
align-items: start | end | center | stretch;
// 垂直方向对齐,顶部对齐|底部对齐|居中|填充
justify-content: start | end | center | stretch | space-around | space-between | space-evenly;
// 整个容器水平对齐
align-content: start | end | center | stretch | space-around | space-between | space-evenly;
// 整个容器垂直对齐
```
#### 单元格属性
```css
grid-column-start
grid-column-end
grid-row-start
grid-row-end
```
